ooooh, I really hope you all are kidding me ok,

@zmogusnr1 I hope you realize what a dvdrip is... it's a rip of the information from the DVD file.... the DVD isn't out yet.... and there isn't any available screener.... maybe some of this is making sense to you? It's rather impossible, a TS is all this person could pull off.

@therestofyou alright, sit back and pop a chill pill, I understand you DON'T like the quality, but did this person ever say "This is a super duper Blu Ray Rip?" cus I'm having trouble finding where he did. Get angry, but don't get mad at this person for doing something that had NO FORCIBLE EFFECTS on your lives, he didn't put it in your face and say "here you fat twat, go ahead and click download or I'm going to blow up your house and kids".
